LOOKLOOK&trade;: Campus Life Food Study
&nbsp;
Part I: Complete on Tuesday, October 2nd&nbsp;
Part II: Complete on Wednesday, October 3rd
&nbsp;
Welcome to the LOOKLOOK&trade; University of Nevada, Reno University Campus Life Food Study!&nbsp; If you have not sent a selfie yet to confirm your participation, please do so before proceeding. Every picture has to be accompanied by a comment, and sends when you tap the checkmark in the lower right-hand corner of your LOOKLOOK&trade; screen.
&nbsp;
This study is all about understanding how you make choices about where, what, why and how you eat &ndash; both on campus and off campus.
&nbsp;
DAY ONE &ndash; we&rsquo;re going to follow you around during a typical day to see where and what you are eating and drinking! With EACH of those posts, please answer questions 1a-d in full.
&nbsp;
DAY TWO &ndash; we need you to pay close attention to the questions below and answer them!&nbsp; Please reference the question number (3a, 3b, 4, etc.) in your responses.
&nbsp;
PLEASE NO ONE WORD ANSWERS.
We realize you are busy &ndash; and perhaps can&rsquo;t comment &ldquo;in the moment&rdquo; as you are documenting your experiences.&nbsp; That&rsquo;s ok &ndash; the beauty of LookLook&trade; is that you can snap pictures (or video, if you are motivated), save to your camera roll, and upload them later when you have time to write the comments.&nbsp; DO THIS WHEN YOU ARE CONNECTED TO STRONG WIFI FOR BEST RESULTS!
&nbsp;
HERE ARE THE TASKS:
Please complete Part I on Tuesday, October 2nd. PART I SHOULD START IN THE MORNING, at&nbsp;breakfast or coffee time.
Please complete Part II on Wednesday, October 3rd.&nbsp;
Your moderator will ask you follow ups throughout the day on Wednesday, October 3rd.
&nbsp;
PART I &ndash; DAY ONE
&nbsp;
FOOD JOURNAL
&nbsp;
1. We want to understand where you choose to eat and drink during a typical day, and how your campus dining options fit into that. It&rsquo;s really important to just behave as you normally would and go about your day; you&rsquo;re just taking us along with you. Throughout the day, snap a picture of whatever you are eating or drinking, and tell us the following WITH EACH PICTURE.&nbsp; PLEASE START THIS WHEN YOU WAKE UP IN THE MORNING!
a. What time is it? Where are you? Are you on-campus, or off-campus? Name of venue?
b. What are you eating?
c. Why did you feel like eating this at this particular place now?
d. What details are important &ndash; like technology, service, atmosphere &ndash; anything that adds or detracts?&nbsp; What was great &ndash; or what could be better?
&nbsp;
PART II &ndash; DAY TWO
&nbsp;
YOU
2. FIRST OFF, we want to know a little about you. Upload a picture that demonstrates the relationship you have with food, and comment on the following:
a. How does it affect your mood and how you feel on a daily basis?
b. What is important to you when it comes to food? Is it taste?&nbsp; Convenience?&nbsp; Healthiness?&nbsp; The ability to personalize your food?
3. Describe (through pictures or screen shots) what your daily routine is like.&nbsp; How much time do you spend in class vs. studying vs. work vs. hanging out with friends? Feel free to use screen shots here but no stock photos please!&nbsp;&nbsp;
&nbsp;
YOUR SCHOOL
4. Upload a photo that represents the student body. What adjectives would you use to describe the student body at U of NE, Reno? Why?
5. Upload a picture that conceptually represents the unique culture at the university. What adjectives would you use to describe the unique culture at U of NE, Reno? Why?
&nbsp;
FOOD AT YOUR SCHOOL
6. Please take pictures of the dining facilities use most often (on or off campus).&nbsp; This can include anything from a caf&eacute; to a vending machine to a convenience store! With each, please describe what we are seeing, and tell us what you get out of it.&nbsp; Are there any ways it could be improved?
7. Upload a photo that represents how you feel about the current campus dining experience at your school. Why have you chosen that photo and what does that photo represent?&nbsp;
8. Are there any branded franchises on the campus today (ie Starbucks, etc) &ndash; or if not, are there ones you&rsquo;d be delighted to see? Take a picture or screenshot of any you&rsquo;d like to see added to the mix.
9. What (if anything) do you miss from home &ndash; food-wise?&nbsp; Take a picture to represent it!&nbsp; Do you think there&rsquo;s any way to replicate this on-campus in any way?
&nbsp;
10. DREAMING&nbsp; &nbsp; &nbsp;
What could your college offer that would really blow your mind &ndash; surprise and delight you when it comes to food and drink fueling your day? This could be new cafes, ethnic cuisines, snacks, restaurants, juice bars, anything you can think of. Submit some screen grabs that bring these ideas to life. Also think beyond food and drink. What else could your college possibly offer you that could make it easier to live the life you want to live on a daily basis? For each idea, please answer: Why would this be on your wish list?
&nbsp;
PLEASE NOTE: We want to see REAL LIFE &ndash; the good, the bad and the ugly. We want to see the food you are proud of, and anything you may not be proud of.&nbsp; Cold pizza for breakfast is totally expected. The more honest and thorough you are the better job you will be doing with this!&nbsp; &nbsp;Please answer ALL THE QUESTIONS that the moderator will ask you about your comments and your pictures. You will be compensated when you have answered all of the moderator&rsquo;s follow-up questions. Thanks so much for participating!
&nbsp;

