INTRODUCTION:
Congratulations on being selected for this Look-Look&trade; study on the role that socks play in your wardrobe!&nbsp;
&nbsp;
Socks seem to be having a moment, and we&rsquo;re exploring what is behind that!&nbsp; You&rsquo;ve been selected for this particular study because of your interest in novelty socks, but we are interested in all the types of socks you buy.
&nbsp;
If you have not yet uploaded a selfie on Look-Look&trade;, please do so now.
&nbsp;
Below are the instructions for the study. For each question, upload a photo or video per the instructions and respond to the comment that goes along with along with it. Your moderator will ask you follow ups throughout the day. Towards the end of the study, your moderator will send some content through the Look-Look&trade; app to get your feedback on.
&nbsp;
Please be open, thoughtful and expressive with your responses. This is not a survey, it&rsquo;s a conversation! Everything you share is for research purposes only.&nbsp;
PRE-WORK VIDEO TOUR:&nbsp; Your Sock Repertoire
&nbsp;
Take us on a video tour of your sock drawer! Ask a friend or family member to film you commenting on the following two subjects.&nbsp; Please post the two videos separately.
&bull; First Video:&nbsp; Show me where and how you store your socks.&nbsp; Are they all jumbled into one drawer?&nbsp; Do you organize them in any way?&nbsp; Take us on a tour!
&bull; Second Video:&nbsp; Before filming, take a moment and prepare some examples of the different types of socks you own and lay them out on your bed.&nbsp; Please pair examples of the types of shoes you wear with each type of sock.&nbsp; Then, on film, show and tell &ndash; for each pair, tell us where you bought it, what brand it is (if you know it) and what role it serves in your wardrobe.
&nbsp;
(Susan will share examples of these two videos for your reference!)
&nbsp;
STUDY DAY!
&nbsp;
Section One:&nbsp; Getting to Know You
&nbsp;
1. VISUAL: Take a few pictures of some things that represent what you feel passionately about.&nbsp; This can be absolutely anything and is very personal &ndash; that is the point!
COMMENT: For each picture (or screenshot) you upload, tell me what I&rsquo;m seeing, and tell me why you are passionate about it.&nbsp; I&rsquo;m looking to understand some of your key values, and what is important to you!
&nbsp;
Your Sock Wardrobe
&nbsp;
2. VISUAL: Take a picture of your three favorite pairs of novelty socks.
COMMENT: For each pair that you photograph and post, please complete this sentence in your own words:&nbsp; &ldquo;I like this pair of socks because ______________________________, and I wear it with ________________.&rdquo;&nbsp; Please include details on where you bought each pair, what brand they are, and if you were aware of the brand when you bought them.&nbsp; Then, on the last of these posts answer the following;&nbsp;&nbsp;
&bull; When you get dressed on any given day, what makes you reach for one pair over another?&nbsp;
&bull; Do you plan your outfits from the bottom up or the top down?&nbsp;
&bull; Do socks ever play a role or even lead your outfit choice?&nbsp; What do your sock choices reflect about your style?
&bull; How long have you been buying &ldquo;novelty&rdquo; socks?&nbsp; When do you typically choose to wear them?
&nbsp;
3. VISUAL: Identify the most &ldquo;superstar&rdquo; pair of socks in your wardrobe &ndash; the pair you love and value the most.
COMMENT: Please complete this sentence in your own words:&nbsp; &ldquo;My superstar pair of socks is ____________ (please specify brand and where you purchased).&nbsp; What makes them a superstar is _________________. A type of sock I feel is missing from my wardrobe is ________________ because _______________.&rdquo;
&nbsp;
Discovering New Sock Brands, Trends, &amp; Looks
&nbsp;
4. VISUAL: Upload several screenshots that represent where you find inspiration and discover fun, new socks.&nbsp; These can include anything from Instagram (or other social platforms), websites, apps to magazines (online or print), actual brick and mortar stores, or any type of media.&nbsp; If a celebrity, influencer or blogger is involved, please name the personality!
COMMENT:&nbsp; (for each):&nbsp; Please complete in your own words:
&nbsp;&ldquo;This is __________________.&nbsp; &ldquo;
&ldquo;When I see a sock design that I think is fun, I &hellip;&rdquo; (buy right away?&nbsp; Make a mental note of it?&nbsp; Keep a screenshot?&nbsp; Google search it?)&nbsp;
&nbsp;
5. VISUAL: Upload a screenshot of your favorite sock brand.&nbsp;
COMMENT: Tell me what you like about that particular brand!&nbsp; What other sock brands are in your repertoire and what can you count on each of them for? How important is the brand when it comes to wearing novelty socks?&nbsp; Where do you most often tend to buy this brand of socks (online, in stores, etc.?)
&nbsp;
&nbsp;
Shopping for Socks (and Other Stuff)
&nbsp;
6. VISUAL: Show me several screenshots of places you go to shop for socks online AND&nbsp; in store.
COMMENT: (for each):&nbsp; Where is this?&nbsp; Why do you buy socks here?&nbsp; How frequently do you purchase socks?&nbsp; Are your sock purchases typically planned or made on impulse?
&nbsp;
7. VISUAL: Upload a photo or screenshot of a pair of socks that you want to buy next.
COMMENT: What is it about this particular pair that draws you in?&nbsp; What inspires sock purchases? (It is out of necessity or can it be fun and satisfying? ) What is it about a fun pair of socks that makes you &ldquo;pull the trigger&rdquo; to purchase it?&nbsp; How long do you keep socks for/how often do you replenish?&nbsp; Do limited edition, collaborations, or &ldquo;exclusives&rdquo; ever play a role in your choices?&nbsp; Why or why not?
&nbsp;
8. VISUAL: Take a screenshot of any type of subscription service that is currently on your radar, that you use, or have tried.
COMMENT: What subscription services are currently on your radar (if any)? If you haven&rsquo;t tried any yet, what might be stopping you?
&nbsp;
Gifting and Receiving Socks
&nbsp;
9. VISUAL: Take a screenshot of any pair of socks you would love to receive as a gift.
COMMENT: If you receive socks as gifts, do you typically ask for specific brands or styles, or do people just know that you like fun socks?&nbsp; When do you like getting socks as gifts (for what occasion?) What do you like about it (if anything)?
&nbsp;
10. VISUAL: Take a screenshot of any pair of socks that you would consider purchasing as a gift for someone else.
COMMENT: Tell me about the store or website where these are sold.&nbsp; Do you buy socks as gifts from the same place where you buy socks for yourself?&nbsp; Why/why not?&nbsp; What do you think makes socks a great gift? Do they need to be special and distinct in some way? Does there need to be a certain price point? How important is the brand name?&nbsp; Why?
&nbsp;
HOT SOX
&nbsp;
11. VISUAL: Upload a screenshot or picture that represents what comes to mind when you hear the name Hot Sox. This can be absolutely anything! (It&rsquo;s fine if you&rsquo;ve never heard of it, by the way &ndash; just go by the sound of the name!)
COMMENT: What did you choose, and why? Were you familiar with Hot Sox prior to this study? If so, what were your impressions?&nbsp;&nbsp;
&nbsp;
AT THIS POINT, YOUR MODERATOR IS GOING TO SHARE SOME THINGS WITH YOU FROM HOT SOX, AND HE OR SHE WILL EXPLAIN WHAT THEY ARE TO GET YOUR FEEDBACK.&nbsp; THANK YOU FOR YOUR PARTICIPATION!
&nbsp;
12. VISUAL: Upload a screenshot or picture of the type of product that Hot Sox should consider offering!&nbsp; What kinds of other socks of legwear should they explore?
COMMENT: What did you choose, and why?&nbsp;
THANK YOU FOR YOUR PARTICIPATION!

