STUDY INSTRUCTIONS
&nbsp;
Welcome to the Smartphone Study!
&nbsp;
You've been selected for this particular study because you own a particular type of Android device with 1 GB of RAM or less. &nbsp;We&rsquo;ll be chatting with you about how you use your phone, specifically which apps you are using and any frustrations you encounter with your phone &ndash; ie slowness, freezing, etc.
&nbsp;
Below are the tasks we need you to complete over the next two days. For each question, please upload a relevant photo with your response. We're just looking for your honest opinions so just give us the straight talk &ndash; there are no right or wrong answers!
&nbsp;
You can work through the study at your leisure &ndash; just make sure to check for follow-up questions from the moderator on your previous posts as you go along!
&nbsp;
&nbsp;
THE TASKS
&nbsp;
DAY 1
TELL US ABOUT YOUR PHONE!
&nbsp;
&bull; PHOTO: &nbsp;Take a screen grab you find on the Internet of your current phone that shows the make and model. &nbsp;COMMENT: &nbsp;Tell me about your phone. &nbsp;How long have you had it?
&nbsp;
&bull; PHOTO: &nbsp;Take a screen grab from the Internet that shows me the place where you purchased or received your phone. COMMENT: &nbsp;How much did you pay for it?&nbsp;
&nbsp;
&bull; PHOTO: &nbsp;Next, go into SETTINGS and take a screen grab of the ABOUT PHONE screen to show me some of the technical aspects of your phone. COMMENT: &nbsp;What operating system does it run? Are you familiar with what storage capacity it has? Amount of RAM? Please upload a screen grab with this information on your phone screen along with your response. &nbsp;If it&rsquo;s too hard to figure out, just tell me that.
&nbsp;
&bull; PHOTO: &nbsp;Take a screen grab of your cell phone carrier. COMMENT: Who provides your service, and how much data do you have to use, per month? Do you watch your data usage closely? &nbsp;Why or why not? &nbsp;Do you have pre-paid service or do you have a contract?
&nbsp;
&bull; PHOTO: &nbsp;Take a screen grab off the internet of your previous phone make and model. COMMENT: &nbsp;What did you use before you got your current phone? &nbsp;Where had you obtained that phone, and what carrier provided your service? &nbsp;How does your newer phone compare to that one? &nbsp;Why did you switch to the new phone?
&nbsp;
&bull; Do you have more than one phone? If not, skip to the next question. &nbsp;If you do have a secondary phone, PHOTO please take a picture of it. &nbsp;COMMENT: &nbsp;what do you use each of your phones for? &nbsp;Why? Is there one phone you are more proud to use in front of other people for any reason?&nbsp;
&nbsp;
&bull; PHOTO: &nbsp;Next, please find an image on the internet that represents how you feel about your data and the limits on your data. &nbsp;Be creative and expressive &ndash; this should be some sort of feeling or emotion! &nbsp;Screen grab and upload it. &nbsp;COMMENT: &nbsp;How do you manage your data plan? Do you ever have to make choices about what you do on your phone according to how much data it might require?
&nbsp;
HOW YOU USE YOUR PHONE
&nbsp;
&bull; PHOTO: &nbsp;Find an image on the internet and take a screen grab of it that represents the role that your smartphone plays in your life. &nbsp;COMMENT: &nbsp;Describe how you use your phone during a typical day. How early in the morning do you check your phone? What do you use your phone for? &nbsp;Work? &nbsp;Entertainment? Other stuff?
&nbsp;
&bull; PHOTO: &nbsp;Take screen grabs of the apps you use the most. &nbsp;This can be anything, from YouTube, to Google Mail, to Google Maps, to Candy Crush. &nbsp;COMMENTS: &nbsp;For each one, please answer these questions:
o What do you use this one for?
o How often do you use it? &nbsp;How many minutes per day would you estimate you spend using this app?
o If you could think of any way you would like to improve the performance of this app, what would it be?
&nbsp;
&bull; PHOTO: &nbsp;Next, please take screen grabs of any websites you browse using your phone. &nbsp;COMMENT: &nbsp;How is the experience, generally speaking, of Internet browsing on your phone? Do you ever run into any problems? &nbsp;I&rsquo;d love to hear about this, in detail!
&nbsp;
&bull; PHOTO: &nbsp;Find an image on the Internet and take a screen grab that shows me how attached you are to your phone. &nbsp;COMMENT: &nbsp;When you think about how important phones are to people these days, where do you fall on that spectrum&hellip; in other words, is your phone one of your most important possessions, or is it just a phone?&nbsp;
&nbsp;
&nbsp;
A NEW SMARTPHONE
&nbsp;
1.  Now we&rsquo;re going to share some benefits of a new kind of smartphone with an optimized operating system for phones that run on 1 GB of RAM or less.&nbsp;
&nbsp;
2. The features they are thinking of including are the following &ndash; we are curious as to which appeal to you and why. &nbsp;With each one, tell me what is interesting about it, AND how appealing it is to you on a scale of 1-10, with TEN being MOST APPEALING.&nbsp;
&nbsp;
a. When I&rsquo;m about to look at a video on YouTube, I can first take a look at how much data will be uses (against my limit) so I can make an easy choice between &nbsp;higher or lower streaming quality. &nbsp;(The lower streaming quality will take up less data.)
b. I can check how much data various apps use (on average) and easily turn them on and off to conserve data
c. I can download YouTube videos while connected to WiFi and then save them to view offline later so I won&rsquo;t use data for watching them
d. I would have a special tool to show me how much data I have left, with an option to top up from my carrier if and when I want to
e. I can preview videos on YouTube before getting caught in an expensive, heavy data download
f. I can share content like photos, videos, etc with a friend or family member in close physical proximity without having to use data or WiFi&nbsp;
g. It would have longer battery life than my current phone
h. It would have more storage than my current phone.
i. I can easily switch my keyboard between two different languages&nbsp;
&nbsp;
3. PHOTO: &nbsp;Find an image on the internet that represents your level of excitement around this new phone and share it with me. &nbsp;COMMENT: &nbsp;Why does this image represent your feelings about the new phone? &nbsp;If a new phone came out priced less than $100 with these features would it be something you might be interested in if you could trade for it? &nbsp;Why? Why or why not?
&nbsp;
DAY TWO
&nbsp;
Welcome to Day Two! Today, we want to see a day in the life of your smartphone!&nbsp;
&nbsp;
You will be journaling everything you do on your smartphone today via LookLook.&nbsp;
&nbsp;
Send us screen grabs of everything you&rsquo;re doing on your phone, whether it&rsquo;s playing a game, making a call, browsing the internet, texting, scrolling through social media, or getting GPS directions, we want to see it all! With every photo you post, please tell us what you&rsquo;re doing on your phone and how well your phone is performing the various tasks. If you have any moments of frustration or gratitude towards your smartphone, we want to hear about them!
&nbsp;
FINALLY, please have someone record you while you create a video for us. The video should be roughly a minute in length. Think about your answers to the questions first, then answer the following questions:
&nbsp;
● What role does your smartphone play in your life?
● If you could talk to your smartphone and ask it to do a better job, how would you ask it to step up its performance?
&nbsp;
THANK YOU! &nbsp;You will be finished with this study when you answer all of the moderator&rsquo;s follow-up questions.
&nbsp;

INTRODUCTION:
Congratulations on being selected for this study on lululemon language and ideas!&nbsp;
&nbsp;
If you have not yet uploaded a selfie on LookLook&reg;, please do so now. In the comment section, please describe how athleisure fits in to your lifestyle!
&nbsp;
Below are the instructions for the study. For each question, upload the screenshot or video requested and carefully answer the corresponding questions. Your moderator will ask you follow ups throughout the day. Look for the blue dot on any post that requires a follow up response. A checkmark means your moderator has resolved the post and there are no more required follow ups!
&nbsp;
Please be open, honest and expressive with your responses. There are no right or wrong answers. It is not a survey, it&rsquo;s a conversation! Everything you share is for research purposes only.
&nbsp;
We are going to start today&rsquo;s study by first showing you a few different words/sayings and asking you follow up questions on each. Don&rsquo;t overthink your responses, just go with what pops into your head first.
&nbsp;
&nbsp;
AT THIS POINT, MODERATOR WILL SHARE A SERIES OF PIECES OF LANGUAGE. DO NOT PROCEED WITH THE REST OF THE QUESTIONS UNTIL YOU HAVE RESPONDED TO THE OPTIONS THAT YOUR MODERATOR SHARES.
&nbsp;
1. VISUAL: There are many athleisure and performance brands out there today! When you think specifically of lululemon at this point and your relationship with the brand, what comes to mind? Upload a screenshot to represent this feeling (these images can be anything &ndash; feel free to be entirely conceptual in this study!)
COMMENT: What does this image represent?&nbsp;
&nbsp;
2. VISUAL: Take a minute and think about what holistic health means to you.&nbsp; Think about all the ways you practice holistic health. What if you were suddenly denied the ability to do this/ these activities?&nbsp; What would that feel like?&nbsp; Upload a screenshot to represent this feeling.
COMMENT: What does this image represent? What do you do to practice holistic health?
&nbsp;
3. VISUAL: As you consider the benefits of holistic health, which are most meaningful to you? How do these benefits contribute to your wellbeing? Post a series of screenshots that capture these benefits (maybe it is one, maybe there are multiple?) and with each, please add a comment that explains what that benefit is and why it is important to you, personally.
&nbsp;
4. VISUAL: Now a &lt;&lt;deep question&gt;&gt;. What do you feel is true about the world today that makes a commitment to holistic health important? Choose a screenshot that represents your opinion on why today&rsquo;s world makes it useful to take the time to exercise.
&nbsp;
5. lululemon values holistic health. The brand&rsquo;s philosophy emphasizes the belief that one&rsquo;s full potential can be ignited when we live to be active, build meaningful relationships (with others and oneself) and develop personally.&nbsp; Please upload a photo or screenshot to represent what comes to mind after you hear this philosophy described by lululemon.
COMMENT: Please describe the photo you posted. How does this philosophy make you feel about the brand? Do you agree with it? Why or why not?
&nbsp;
a. Next, knowing what each is meant to represent, has your opinion on what you like/dislike about any of them changed? If so, which ones, and how has your opinion changed?
&nbsp;
b. Please rank the options in order of which ones BEST suit this philosophy.&nbsp; With 10 being the most fitting and 1 being the least fitting. Why did you rank them in this order?
&nbsp;
&nbsp;
c. If lululemon were to use &ldquo;&rdquo;x&rdquo;, &ldquo;x&rdquo;, or &ldquo;x&rdquo; to evoke this philosophy, how easily understood do you think it would be? Please provide a rating for each. [write out each with the rating next to it] 1: Extremely Unclear &ndash; 10: Extremely Easy to Understand
&nbsp;
d. How unique do you think it would be?&nbsp; Please provide a rating for each. [write out each with the rating next to it] 1 Not Unique at all &ndash; 10 Extremely Unique
&nbsp;
e. How memorable (i.e. easy to remember) would it be? Please provide a rating for each. [write out each with the rating next to it] 1 Not Memorable at all &ndash; 10 Extremely Memorable
&nbsp;
6. VIDEO: Your final task is to have a friend of family member film a video of you speaking on the following topic. Please finish these two sentences in your own words: &ldquo;After thinking about the idea of holistic health and its importance in the world today, I&nbsp; think the best articulation of this philosophy for lululemon is&nbsp; ___________________ because ___________________.&nbsp; My feelings about buying the brand have (or have not) changed after thinking about this language associated with lululemon.
&nbsp;
Thank you for your participation!
&nbsp;

