LOOKLOOK&trade;: New Experiences from Familiar Liquors!
Welcome to the LOOKLOOK&trade; Study on Liquor Innovation.&nbsp; If you have not yet sent a selfie to confirm your participation, please do so before continuing.&nbsp; Every picture has to be accompanied by a comment and sends when you tap the arrow in the lower right-hand corner of your LOOKLOOK&trade; screen.&nbsp;
The goal of this study is to share some trends with you and get your thinking on how a few Canadian liquor brands can capitalize on these trends to generate some new experiences &ndash; whether that is in the form of new flavors, new ways of drinking the liquors, new packaging or even sponsorships or partnerships.
PLEASE NOTE:&nbsp; We want total, candid honesty. There is no right way or wrong way to answer these questions &ndash; we just want genuine input.&nbsp; You do not have to be a fan of any of the brands we&rsquo;ll bring up.&nbsp; Also, keep it simple and just answer for yourself!&nbsp; You don&rsquo;t have to solve any marketing problems for all of Canada.
All information will be held STRICTLY CONFIDENTIAL for research purposes only.
&nbsp;
HERE ARE THE QUESTIONS
1) INSPIRATION FROM HEALTH, FLAVOR AND PROVENANCE. (20 minutes &ndash; 5 for each category of liquor &ndash; please repeat question 1a, 1b, and 1c for rum, gin, and vodka after answering the questions on whisky)
a. Health &amp; Wellness.&nbsp; Think for a minute about a way that whisky could offer some kind of&nbsp; benefit on this front.&nbsp; TAKE A PICTURE OF WHAT THAT HEALTH AND WELLNESS BENEFIT MIGHT LOOK LIKE.&nbsp; What is this?&nbsp; What is the sensation or experience this would provide, and why is that appealing to you?&nbsp;
b. Flavor.&nbsp; TAKE A PICTURE OF A FOOD OR FLAVOR YOU FEEL PAIRS WELL WITH WHISKY. No rules here! What sounds good to you?&nbsp; Why do you think it sounds good?
c. Setting/Ambience.&nbsp; Now, TAKE A PICTURE OF THE IDEAL SETTTING FOR DRINKING WHISKY OR A WHISKY COCKTAIL.&nbsp; How do you like to drink your whisky?&nbsp; What is this image all about &ndash; what are we looking at here?&nbsp; What is the vibe and what is the emotion or feeling that is inherent in this setting?
&nbsp;
[REPEAT FOR RUM, GIN AND VODKA]
&nbsp;
2) BRINGING DYNAMIC EXPERIENCES TO LIQUOR BRANDS (15 minutes)
a. Power to the People.&nbsp; Think about any brand that has done a great job of harnessing collective power &ndash; from crowdsourcing to supporting a group of people or providing a sense of popular momentum.&nbsp; If any specific example comes to mind, please UPLOAD A SCREENSHOT OF THAT BRAND.&nbsp; If nothing comes to mind, it&rsquo;s ok &ndash; but think about your favorite liquor brand that we&rsquo;ve just discussed.&nbsp; How could it bring that kind of collective dynamic into the brand experience?&nbsp; PLEASE UPLOAD A SCREENSHOT OF THAT IDEA and describe!
b. Doing Good.&nbsp; Are there any brands that you feel have done a top-notch job of incorporating philanthropic principles into its brand?&nbsp; UPLOAD A SCREENSHOT OF THAT BRAND.&nbsp; Now think about your favorite liquor brand that we&rsquo;ve just discussed.&nbsp; What would truly blow your mind in terms of them working a philanthropic initiative into that brand?&nbsp; PLEASE UPLOAD A SCREENSHOT OF THAT IDEA and describe!
c. [Women only] Feminine Identity.&nbsp; Think about anything that has successfully shed outdated girly clich&eacute;s in lieu of a more modern female identity.&nbsp; UPLOAD A SCREENSHOT OF THAT EXAMPLE.&nbsp; Now think a way that any of the liquor brands we&rsquo;ve just discussed could create a flavor or experience or even a way of promoting itself that would feel reflective of a fresh, authentic female identity?&nbsp; PLEASE UPLOAD A SCREENSHOT THAT REFLECTS THIS IDEA and describe!
&nbsp;
3) YOUR IDEAS! (10 minutes)
Finally, I would love to hear at least one idea you have for a new liquor experience for each of the following five brands: Lamb&rsquo;s Rum, Polar Ice Vodka, Ungava Premium Canadian Gin, Lot 40 Canadian Whisky, and J.P. Wiser&rsquo;s Canadian Whisky. This can be ANYTHING from packaging to flavors, to a partnership with another type of product or even a sponsorship.&nbsp; UPLOAD A SCREENSHOT THAT BRINGS A PIECE OF THIS IDEA TO LIFE. For each, describe what would blow your mind if it were realized/brought to life!
&nbsp;
THANK YOU FOR YOUR PARTICIPATION!&nbsp;&nbsp;
&nbsp;

