Welcome to the LOOKLOOK&reg; Campus Life and Food Study!&nbsp; If you have not sent a selfie yet to confirm your participation, please do so before proceeding. Every picture has to be accompanied by a comment and sends when you tap the checkmark in the lower right-hand corner of your LOOKLOOK&reg; screen.
This study is all about understanding how you make choices about where, what, why and how you eat &ndash; both on campus and off campus.
PART ONE (DAY ONE) &ndash; we need you to pay close attention to the questions below and answer them!&nbsp; Please reference the question number (1a, 2b, etc) in your responses.
PART TWO (DAY TWO) &ndash; we&rsquo;re going to follow you around during a typical day to see where and what you are eating!&nbsp; With EACH of those posts, please answer questions 10a-d in full.
PLEASE, NO ONE WORD ANSWERS!&nbsp; You&rsquo;re getting paid for your thoughtful opinions! &nbsp;
We realize you are busy &ndash; and sometimes can&rsquo;t comment &ldquo;in the moment&rdquo; as you are documenting your experiences.&nbsp; That&rsquo;s ok &ndash; the beauty of LookLook&reg; is that you can snap pictures, save to your camera roll, and upload them later when you have time to write the comments.&nbsp; POST WHEN YOU ARE CONNECTED TO STRONG WIFI FOR BEST RESULTS!
HERE ARE THE TASKS:
Please complete Part I by 3:00 pm on Wednesday, January 16th.
Please complete Part II on Thursday, January 17th. PART II SHOULD START IN THE MORNING, at breakfast or when you&rsquo;re grabbing coffee.
&nbsp;Your moderator will ask you follow ups throughout the day on Thursday, January 17th.
PART I
YOU&nbsp;
1. FIRST OFF, we want to know a little about you. Upload a picture that demonstrates the relationship you have with food, and comment on the following:
a. How does it affect your mood and how you feel on a daily basis?
b. What is important to you when it comes to food? Convenience?&nbsp; Health?&nbsp; Quality of the food? Ability to personalize it?
&nbsp;
2. Describe (through a few pictures or screen shots) what your daily routine is like.&nbsp; Please comment on the following:&nbsp; How much time do you spend in class vs. studying vs. work vs. hanging out with friends?&nbsp;
YOUR SCHOOL
3. Upload a picture that conceptually represents the unique culture at your school.&nbsp; What three adjectives would you use to describe the campus culture at your school? What adjectives would you use to describe the student body?&nbsp; What makes this place unique?
FOOD AT YOUR SCHOOL
4. Please take pictures of any dining facilities you use most often on campus.&nbsp; This can include anything from a caf&eacute; to a vending machine or convenience store! With each, please describe what you are sharing and what you get out of it. How can it be improved?&nbsp; We want details here, down to the condiments you prefer for your tea or coffee.&nbsp;&nbsp;
5. Upload a photo that represents how you feel overall about the current campus dining experience at your school. Why have you chosen this and what does it represent?
6. Take pictures of any branded franchises that exist on your campus today (i.e., coffee shops, fast food etc) and tell me if you ever frequent them, and why or why not.&nbsp; Are there others you&rsquo;d be delighted to see? If so, upload screenshots of them and tell me what you would like about adding them!&nbsp;&nbsp;
FOOD AWAY FROM SCHOOL
7. Now let&rsquo;s talk about where you go to eat off campus. Upload some screen shots of places you most often visit.&nbsp; For each, please answer:&nbsp; when do you tend to go here?&nbsp; How often?&nbsp; Why do you choose it? What does this place have that you can&rsquo;t find on campus? In general, how often would you say you go off campus to eat or drink?&nbsp;&nbsp;
PART II
&nbsp;
FOOD JOURNAL
We want to understand where you choose to eat and drink during a typical day, and how your campus dining options fit into that.&nbsp; It&rsquo;s really important to just behave as you normally would and go about your day; you&rsquo;re just taking us along with you. Throughout the day, snap a picture of whatever you are eating or drinking, and tell us the following WITH EACH PICTURE.
8. What time is it?  Where are you? Are you on-campus, or off-campus? Name of venue? Alone or with friends?
9. What are you eating?
10. Why did you feel like eating this at this particular place now?&nbsp;
11. What details are important &ndash; how is the QUALITY?&nbsp; HEALTHINESS?&nbsp; CONVENIENCE FACTOR?&nbsp; PERSONALIZATION FACTOR?&nbsp; What was great &ndash; or what could be better?&nbsp;
PIE IN THE SKY
12. What could your college offer that would really blow your mind &ndash; surprise and delight you when it comes to food and drink fueling your day? This could be new cafes, ethnic cuisines, snacks, restaurants, juice bars, anything you can think of. Submit some screen grabs that bring these ideas to life. Think beyond food and drink. What else could your college offer you that would improve your quality of life on a daily basis? For each idea, please answer: Why would this be on your wish list?&nbsp;
PLEASE NOTE: We want to see REAL LIFE &ndash; the good, the bad and the ugly. We want to see the food you are proud of, and anything you may not be proud of.&nbsp; Cold pizza for breakfast is totally expected. The more honest and thorough you are the better job you will be doing with this study.&nbsp;
