LOOKLOOK&reg; STUDY INSTRUCTIONS: Runners Collective
INTRODUCTION: Congratulations on being selected for this study on running!&nbsp; We&rsquo;ll be exploring the role it plays in your life and your needs when it comes to the gear you use!&nbsp;
Starting now through March 17th, we want you to keep a diary on LookLook&reg; about running, including the details of each time you run. Most importantly, we will be digging into your product choices and needs in and around your runs. There are also some topics in here regarding the general role running plays in your life, as well as how you shop for run gear.&nbsp;&nbsp;
We anticipate answering the questions on these instructions will take about 2 hours total, but you can totally complete it on your own time, and in small segments (we know you&rsquo;re super busy!) On March 18th, please set aside an additional hour for a moderator to ask follow-up questions on your posts.&nbsp;
Below are the instructions for the study. For each question, upload the video, photo or screenshot requested and carefully answer the corresponding questions.&nbsp; When he or she is satisfied with a conversation thread, the moderator will &ldquo;resolve&rdquo; the post. You will be complete when all of your posts are resolved.&nbsp;
Please be open, honest and expressive with your responses. This is not a survey, it&rsquo;s a conversation! Everything you share is for research purposes only. We love all the details and the more specific the better.&nbsp;
INTRO - YOUR RUNNING LIFE&nbsp;
1. VIDEO: Please create a video about you as a runner and why running is important to you. (You can ask a friend to film you or capture it yourself.) What are 3 adjectives that describe you as a runner?&nbsp; What does running mean to you? When and why did you start running and why do you continue? How do you feel when you run?&nbsp; Aim for about 2 minutes on this.
&nbsp;
2. VISUAL: Please share a photo of an athlete or runner that inspires you or that you admire. COMMENT: Please tell us about this person. What do you find inspiring? What do you admire? And how does this connect to you?
&nbsp;
3. VISUAL: Please upload a photo or screen shot that visually represents your relationship with running. This can be anything! COMMENT: How often do you run/workout? How long are your runs, i.e. in time or distance? What makes them vary &ndash; weekend/weekday? Weather? Mood? Whether you are along or with others? Do you have specific goals for 2019 and beyond? How does the product change depending on the types of runs you described?
&nbsp;
RUN DIARY&nbsp;
Please share the videos outlined below for ALL the runs that you do through the end of day Sunday. We&rsquo;re really interested in the products you choose to wear when running and why. We&rsquo;d love for you to upload at least two of these over the course of the exercise! Three or more would be fantastic!
&ldquo;BEFORE&rdquo; VIDEO: Before you start, please briefly tell us how you&rsquo;re feeling, and a few details about this particular run. For example - is it part of a training plan, general exercise, fun, relaxation, etc.? What is your goal (distance, time, speed, finish, etc.)? What time of day is it? Are you indoor or outdoor? If outside, what&rsquo;s the weather like? What surface are you on? Are you alone or with others? Please tell us about the gear you are wearing and why you chose it for today. We are particularly interested in these choices, so please share as much detail as possible in this portion of your video. FOR EACH, please answer: what it is, what brand is it, why you chose it, what you love about it, what it does for you, anything you feel is compromised with it (ie opportunity to improve), and if there is any other piece of gear you wish you had for your run today (anything missing?).
&ldquo;AFTER&rdquo; VIDEO: Please video yourself at the end of your run. From head to toe, show us how you are feeling and what you look like as you wind down. How did your gear perform during the run? What worked well? And what did not? How did you feel in your gear, during and then after your run? What do you need or want to see improved?
&nbsp;
OPTIONAL &ldquo;DURING&rdquo; VIDEO: During your run, IF you have any observations about your gear, the way you feel, or anything else and you&rsquo;d like to share, please upload an additional video discussing those observations.
&nbsp;
FAVOURITE RUNNING GEAR:
4. Next, we&rsquo;d like you to create a video introducing us to your favorite running gear.&nbsp; Before filming, take a moment to prepare and lay out three (3) of your favourite pieces of running gear on your bed. For this exercise, don&rsquo;t bother with shoes. Now, please ask someone to film you using your phone answering the following:&nbsp; &nbsp;
WHAT TO TELL US IN YOUR VIDEO &ndash; FOR EACH ITEM:
What brand is this and why did you buy it? Roughly how much of your running/activewear wardrobe is made up of this brand? What type of run or workout do you do while wearing this piece? (short/long, indoor/outdoor, training/race, hot/cold weather, etc.). We are super interested in why you choose specific items to wear for specific runs. What product characteristics make this item good for doing that?&nbsp; (ie comfort, breathability, waterproof, insulated from cold/heat, moisture wicking, style, material, purity/sustainability). Does this vary throughout the year? Do you ever wear this item for things other than running (including non-sweat activities)? Why or why not? Would you change anything about it &ndash; if so, what?
&nbsp;
NOTE: If you want to submit three separate videos, that&rsquo;s cool. Or if you would rather do the three pieces in one take, that is also fine &ndash; but keep the overall length to about three minutes max.
&nbsp;
[MODERATOR PROBES: Is there anything missing from your closet?&nbsp; Is there anything you&rsquo;ve had in the past and wanted to replace but haven&rsquo;t been able to find?]
&nbsp;
CONSIDERING NEW GEAR
5. VISUAL: Please post a screenshot or two of the places that immediately come to mind for purchasing running gear. COMMENT: What is this, and what can you count on it for?&nbsp; What is it missing (if anything?) What typically initiates a trip to buy run gear? How often do you replace gear? When you enter a retail environment (online or in-store), what are you hunting for? How do you narrow down choices? What is usually the deciding factor?&nbsp;
&nbsp;
6. VISUAL:&nbsp; Please take a few screenshots of run brands that you consider a &ldquo;go-to&rdquo; for your running. COMMENT:&nbsp; FOR EACH, please indicate to what extent would you agree each brand &ldquo;is a brand for me&rdquo; on a scale of 1-5 (with 5 being the strongest)? Please explain why it resonates with you! Do any of these brands in particular align with your values? If so, how?&nbsp; What makes a brand credible in creating run product? What makes their run product unique or differentiated from other brands?
&nbsp;
7. WRAP-UP VIDEO: Finally, let&rsquo;s talk about lululemon and running. Please address the following in your final video:&nbsp; When you think about lululemon&rsquo;s current run products, what comes to mind? Do you trust lululemon&rsquo;s products for your running? Why or why not? Has there ever been a time when you&rsquo;ve tried lululemon and had a product not work for you? If so, why? What could lululemon potentially bring to the world of running? What products would you like to see the Design Team create specifically for your needs, and why? Please be as open and honest as possible!
&nbsp;
FEEL FREE TO POST ANYTHING ELSE ABOUT YOUR FAVOURITE RUN PRODUCT THAT YOU THINK WOULD HELP OUR DESIGN TEAM AT LULULEMON!
THANK YOU FOR YOUR PARTICIPATION!&nbsp;
&nbsp;

