LookLook&reg; STUDY:&nbsp; &nbsp;Fashion | Shopping | Life!
&nbsp;
INTRODUCTION:
&nbsp;
Congratulations on being selected for this LookLook&reg; study on how you shop for fashion today and the role it plays in your life! We wanted you in the study not only because you are passionate about fashion, but also because you are articulate and comfortable reflecting on your interests and shopping behavior.&nbsp; We want to get into the details!
&nbsp;
If you have not yet uploaded a selfie on LookLook&reg;, please do so now.
&nbsp;
We are looking to paint the big picture with this study &ndash; what does fashion mean to you at this point in your life, and how do you make choices in today&rsquo;s busy world when there are so many ways to discover new looks, new brands and new ways of shopping?
&nbsp;
Below are the instructions for the study.&nbsp; Please be open, thoughtful and expressive with your responses.&nbsp; This is not a survey, it&rsquo;s a conversation!&nbsp; Everything you share is for research purposes only.
&nbsp;
PRE-STUDY HOMEWORK:
Prior to your day of participation and dialogue with your moderator, we&rsquo;d like to get a sense of your personal sense of style and brands you consider your &ldquo;go-to&rsquo;s!&nbsp; These questions need to be completed when you are at home with access to your wardrobe.&nbsp; It should take about half an hour.
&nbsp;
GO-TO &ldquo;LOOKS&rdquo;
VISUAL:&nbsp; POST THREE OF YOUR GO-TO LOOKS.&nbsp; We&rsquo;d love to understand what kind of outfits you put together, as a reflection of your current lifestyle and your personality.&nbsp; If you think about your day to day rhythm, how many occasions do you regularly dress for, and what is the type of go-to outfit you create for them?&nbsp; (For ex., one person might have these four: &ldquo;date night&rdquo;, &ldquo;creative meeting&rdquo;, &ldquo;chic and comfy out-and-about.&rdquo; But someone else might have: &ldquo;client meeting&rdquo;, &ldquo;girls&rsquo; night&rdquo;,&nbsp; &ldquo;Netflix and Chill&rdquo;). This is all about your particular life style! Please lay out each outfit on your bed and photograph it in good light.&nbsp; Shoes and handbags would be a great touch to complete the look if you feel like adding!&nbsp; But apparel is the focus of this exercise.
&nbsp;
COMMENT:&nbsp; IN EACH POST, tell me the following:&nbsp; (i) What do you call this type of look, and how often do you wear it? (ii) Who is the designer of each piece and where did you buy? (iii) Where do you typically shop for this type of look? Why?
&nbsp;
STUDY DAY!&nbsp;&nbsp;
So, today we are going to get a little more detail about certain topics. Looking for total honesty here &ndash; as well as creativity in how you answer these questions!&nbsp; Below are the key questions I&rsquo;d like you to answer, along with the visuals to accompany each comment.&nbsp; Look out for my follow-ups!
&nbsp;
DISCOVERY AND INSPIRATION
VISUAL:&nbsp; Post at least three screenshots of places you go online that INSPIRE the types of clothing you buy. (This can include any social media, editorial, email from a brand, store sites, apps, or brand sites/apps.).&nbsp; Where do you tend to discover new products/styles?&nbsp; With each one, please complete the comment below:
&nbsp;
COMMENT:&nbsp; Please complete in your own words:&nbsp; &ldquo;This is ___________.&nbsp; I go here (insert frequency &ndash; per day, per week, per month, etc).&nbsp; I&rsquo;m drawn to this because ______________________.&rdquo;
&nbsp;
WHY YOU SHOP
VISUAL:&nbsp; Find any image or picture (even an emoji) that represents the feeling that shopping (for apparel and accessories) brings alive in you.
&nbsp;
COMMENT:&nbsp; Please complete in your own words:&nbsp; &ldquo;I chose this image because it represents my feeling of _______________ when I shop for clothes/accessories.&rdquo; Why do you shop &ndash; is it always for replenishment of something you need &ndash; or do you shop for fun? At its best, what does a great shopping experience give you?&nbsp; What really motivates you to make purchases? (ads, promotions, events, Instagram, etc)
&nbsp;
WHERE YOU SHOP
VISUAL:&nbsp; Think about the top 3 places where you spend the majority of your apparel dollars.&nbsp; Post a screenshot of each destination (please list at least 2!)
&nbsp;
COMMENT (FOR EACH):&nbsp; Please complete in your own words:&nbsp; &ldquo;I tend to buy a lot of my fashion here:&nbsp; _______________________ because&nbsp; __________________&rdquo;.&nbsp; What percentage of your apparel money goes to this place, and why?
&nbsp;
HOW YOU SHOP (IN THE DIGITAL WORLD!&nbsp;
VIDEO:&nbsp; Next, you&rsquo;re going shopping on your phone. Just go browsing for fun. You could look for a specific item or you could just go on a favorite site or to a favorite shopping app to look around and see what you like.
&nbsp;
We want you to record your screen with audio while you do this (instructions below if you are not familiar with how to do this.)
&nbsp;
Spend about 1-2 minutes browsing for the item. While you&rsquo;re browsing, just say out loud what you are thinking.&nbsp; Tell us where you start your search and voice out loud your comments as you browse. As you click through different options, tell me why you are making your choices of where to go and what to look at. After you record for a few minutes, upload your video to LookLook&reg;. Note: you do not have to be a Ninja at this! Just look around and talk to me while you&rsquo;re browsing on your phone. If you get frustrated for any reason, mention that!
&nbsp;
How to screen record on an iPhone (please be sure to turn on audio!)
1. Go to Settings &gt; Control Center &gt; Customize Controls, then tap next to Screen Recording.
2. Swipe up from the bottom edge of any screen.&nbsp;
3. Press the record button firmly until the screen recording box comes up (it takes 3 seconds), turn the microphone on, and then tap Start Recording.&nbsp;
4. Upload your video to LookLook&reg;
&nbsp;
How to screen record on an Android phone
5. Download and use the free app Mobizen&nbsp;
6. Enable sound before recording
7. Upload your video to LookLook&reg;
&nbsp;
HOW YOU SHOP (IN-STORE)
VISUAL:&nbsp; As you consider where you really enjoy shopping the most, think about services you receive that make you feel loyal towards that place.&nbsp; Screenshot something (or a few!) that represent(s) that experience.&nbsp;&nbsp;
&nbsp;
COMMENT:&nbsp; (FOR EACH ONE): Please complete in your own words:&nbsp; &ldquo;Services that I enjoy at my favorite apparel/accessories stores include _______________________&rdquo;.&nbsp; These could include anything from tailoring to transactional services such as digital receipts and mobile payment to styling, events, exclusive product lines, delivery or gifting options, to having a &ldquo;text relationship&rdquo; with a local sales associate who provides personal messages about new arrivals or upcoming promotions.&nbsp; &nbsp;&nbsp;
&nbsp;
HOW IT ALL COMES TOGETHER&nbsp;
VISUAL:&nbsp; Imagine for a moment that someone handed you the luxury of an entire afternoon to go clothing shopping &ndash; just for you.&nbsp; How would you enjoy this gift of time? Would you curl up on the couch and go shopping online? Would you visit boutiques? A mall? Post a screenshot (or a few) of where you would go shopping.
&nbsp;
COMMENT:&nbsp; (FOR EACH ONE): Where is this? What do enjoy most about this experience? Provide as much detail as possible!&nbsp; &nbsp;&nbsp;
&nbsp;
INTERMIX&nbsp;
&nbsp;
WHO IS THE INTERMIX WOMAN?
VISUAL:&nbsp; Please screenshot a picture that represents, in your mind, the woman who shops a lot of Intermix. (If you are not familiar at all with the brand, feel free to check out the website.) This can be anyone!&nbsp; A celebrity, whatever pops into your head (don&rsquo;t over think it!)
&nbsp;
COMMENT:&nbsp; Please complete: &ldquo;I chose this image because_____________.&rdquo;&nbsp;&nbsp;
&nbsp;
URGENCY
VISUAL:&nbsp; Take a screenshot or picture of any type of retailer that you feel more excitement and urgency around shopping vs. Intermix.
&nbsp;
COMMENT:&nbsp; What did you choose, and why?&nbsp; What do you think would give you more of a sense of excitement about getting to know the Intermix experience a bit better?&nbsp; (Be completely honest!)&nbsp;&nbsp;
THANK YOU FOR YOUR PARTICIPATION!
