1. VISUAL: Reflect for a second about WHEN you first started struggling with insomnia. Now, upload a screenshot that represents what you think has caused your insomnia. (You can be conceptual and creative with this choice of image! No right or wrongs here)
COMMENT: What is this image and what does it represent? Was insomnia something that just came on or do you think it was just caused by something that happened in your life/world? What finally prompted you to seek treatment?&nbsp;
&nbsp;
&nbsp;
2. VISUAL: Think for a minute about what part of insomnia you fear most (falling asleep? Staying asleep? The reliance on drugs? The after-effects of drugs? Something else?) and find a screenshot to upload that represents that fear.
COMMENT: What is this and why did you choose it? How does insomnia impact your life? (At night, in bed, in the morning, during the day&hellip; or all of it?) How does that make you feel?
&nbsp;
&nbsp;
&nbsp;
Treatment
&nbsp;
3. VISUAL: Take a picture of the medication(s) (RX, over the counter or herbal) that you take to treat your insomnia.&nbsp;
COMMENT: How long have you been taking these? What sort of physician treats and prescribes medication for your insomnia (primary care doctor? Psychiatrist? Neurologist? Sleep specialist?) Did they immediately prescribe meds? Or did they encourage you to try behavioral changes first (adjusting bedtime, diet, etc) If that was the case, how long did it take for them to prescribe an RX?
&nbsp;
4. VISUAL: Upload an emoji that represents your current feeling about how SUCCESSFUL your current medication is for you. COMMENT: Why did you choose this emoji?&nbsp; How is your medication supposed to help with your insomnia specifically? What does success feel like for you? How well does your medication perform against this definition of success? Are there side effects?&nbsp;
&nbsp;
5. VISUAL: Think about any side effect you have experienced with your current or past medications for insomnia. Upload a screenshot that conceptually represents each side effect you experienced (Note: this is the most important part of the study!)
COMMENT (for each): What does this represent? When does the side effect hit (morning after? Day after? Ongoing? Please be as detailed as possible in your description of this experience. Have you ever considered switching RX?&nbsp;
&nbsp;
&nbsp;
&nbsp;
&emsp;
LOOKLOOK&reg; STUDY: Part Two &ndash; Creative Ideas
Next, your moderator will send you descriptions of a new medication called DayVigo.&nbsp;
[MODERATOR TO SHARE OPTION K]
Please fill in this sentence: &ldquo;The words or phrases I like about Option K are:____________ because _____________________.&rdquo; Then use your own words to tell me anything about the idea that you like, that is appealing, that seems different than other insomnia pharmaceutical medications. If it is not appealing, please share your thoughts on why it turns you off or is confusing. Be as specific as possible.
&nbsp;
[MODERATOR TO SHARE OPTION M]
&ldquo;Please fill in this sentence: The words or phrases I like about Option M are:____________ because _____________________.&rdquo; Then use your own words to tell me anything about the idea that you like, that is appealing, that seems different than other insomnia pharmaceutical medications. If it is not appealing, please share your thoughts on why it turns you off or is confusing. Be as specific as possible.
&nbsp;
[MODERATOR TO SHARE PRINT AD 1]
Please fill in this sentence: &ldquo;What I like about this print concept is _______________________.&rdquo; Then use your own words to tell me anything about the idea that you like, that is appealing, that seems different than other insomnia pharmaceutical medications. If it is not appealing, please share your thoughts on why it turns you off or is confusing. Be as specific as possible.
&nbsp;
[MODERATOR TO SHARE PRINT AD 2]
Please fill in this sentence: &ldquo;What I like about this print concept is _______________________.&rdquo; Then use your own words to tell me anything about the idea that you like, that is appealing, that seems different than other insomnia pharmaceutical medications. If it is not appealing, please share your thoughts on why it turns you off or is confusing. Be as specific as possible.
&nbsp;
[MODERATOR TO SHARE&nbsp; VIDEO]
PLEASE NOTE &ndash; THESE ARE ROUGH EXECUTIONS &ndash; PLEASE IGNORE THE TEXT ABOUT &ldquo;INSERT BRAND CONTENT&rdquo;. Please fill in this sentence: &ldquo;What I like about this video concept is _______________________.&rdquo; Then use your own words to tell me anything about the idea that you like, that is appealing, that seems different than other insomnia pharmaceutical medications. If it is not appealing, please share your thoughts on why it turns you off or is confusing. Be as specific as possible.
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;
&nbsp;
FINAL VIDEO &ndash; PARTICIPANT TO POST
Now that you&rsquo;ve heard the new medication described from a number of perspectives, would this new idea get you motivated to talk to your doctors, or rethink what you are currently doing to treat your insomnia?
&nbsp;
To answer that question, please ask a friend or family member to film you speaking about what piece of communication speaks most to you and why.&nbsp; Please start this way: &ldquo;Of the five articulations of the idea, the part that spoke to me the most was _____________________ because _____________________.&rdquo; I would (or would not) be motivated to talk to my doctor about this new medication because _______________________.&rdquo;
&nbsp;
&nbsp;Your video should ideally be 30 seconds &ndash; 1 minute in length.&nbsp;
&nbsp;
THANK YOU FOR YOUR PARTICIPATION!&nbsp;
