INTRODUCTION:
Congratulations on being selected for this Look-Look&trade; study on the role that socks play in your wardrobe!&nbsp;
&nbsp;
Socks seem to be having a moment, and we&rsquo;re exploring what is behind that!&nbsp; You&rsquo;ve been selected for this particular study because of your interest in fashion socks, but we are interested in all the types of socks you buy.
&nbsp;
If you have not yet uploaded a selfie on Look-Look&trade;, please do so now.
&nbsp;
Below are the instructions for the study. For each question, upload a photo or video per the instructions and respond to the comment that goes along with along with it. Your moderator will ask you follow ups throughout the day. Towards the end of the study, your moderator will send some content through the Look-Look&trade; app to get your feedback on.
&nbsp;
Please be open, thoughtful and expressive with your responses. This is not a survey, it&rsquo;s a conversation! Everything you share is for research purposes only.&nbsp;
PRE-WORK VIDEO TOUR:&nbsp; Your Sock Repertoire
&nbsp;
Take us on a video tour of your sock drawer! Ask a friend or family member to film you commenting on the following two subjects.&nbsp; Please post the two videos separately.
A. First Video:&nbsp; Show me where and how you store your socks.&nbsp; Are they all jumbled into one drawer?&nbsp; Do you organize them in any way?&nbsp; Take us on a tour!
B. Second Video:&nbsp; Before filming, take a moment and prepare some examples of the different types of socks you own and lay them out on your bed.&nbsp; Please pair examples of the types of shoes you wear with each type of sock.&nbsp; Then, on film, show and tell &ndash; for each pair, tell us where you bought it, what brand it is (if you know it) and what role it serves in your wardrobe.
&nbsp;
(Susan will share examples of these two videos for your reference!)
&nbsp;
STUDY DAY!
&nbsp;
Getting to Know You
&nbsp;
1. VISUAL: Take a few pictures of some things that represent what you feel passionately about.&nbsp; This can be absolutely anything and is very personal &ndash; that is the point!
