项目介绍：
恭喜您被选中参加本次 LOOK-LOOK&trade; 关于时尚与街头服饰的调研活动！
&nbsp;
以下是关于本次调研的项目指南。请您根据每个问题的要求，上传一条相应的图片或视频，并给出相应的文字解释。主持人随后会根据您的回答跟进一系列后续问题，届时请注意查看消息提示。希望您能包容，慎重，并具有张力地回答这些问题，把它当作一次有趣的谈话，而非一场调查。
