 回想你人生中的某个突破性时刻，是何时你感觉你迈出了人生中的一大步，并迈入了一个全新的，激动人心的时期？当时的具体情况是什么呢？&nbsp;
 接上一个问题，那时的你经历了何种努力，战胜了什么困难，才最终收获了那个突破性的时刻？
 你最近一次改变你健身习惯是什么时候？是什么激励你下决心改变的？
 不断追求健康的过程中，&lsquo;尝试&rsquo;一词对你来说扮演着怎样的角色？在你的生活中呢？
&nbsp;
